import * as React from "react";
import { data } from "../Data/data";
import "./Footer.css";
import { TextField, Autocomplete, Box } from "@mui/material";
import { MdArrowDropDown } from "react-icons/md";
import { FaFacebookF, FaLinkedinIn } from "react-icons/fa";

import { BsInstagram, BsTwitter } from "react-icons/bs";

import App_store from "../../Images/App_store.png";
import Google_play from "../../Images/Google_play.png";

import logo from "../../logo.svg";

import { useNavigate } from "react-router-dom";
import { FooterEN, FooterDE, FooterTH } from "../Data/DataLanguage";
const Footer = (props) => {
  const navigate = useNavigate();
  let languages = props?.v;
  const switchLanguage = (x) => {
    if (x === "English") {
      navigate("/", { state: { languages: `${x}` } });
    } else if (x === "German") {
      navigate("/", { state: { languages: `${x}` } });
    } else if (x === "Thai") {
      navigate("/", { state: { languages: `${x}` } });
    } else {
      navigate("/", { state: { languages: "English" } });
    }
  };
  console.log("props:", props?.v);
  return (
    <>
      {languages === "English" ? (
        <>
          <div className="ContentFooter">
            <img src={logo} alt="logo" style={{ width: 160, float: "left" }} />
            <div style={{ float: "left", marginLeft: 100 }}>
              <p className="textFooter1">{FooterEN[0].label}</p>
              <p className="textFooter1">{FooterEN[1].label}</p>
              <p className="textFooter1">{FooterEN[2].label}</p>
              <div style={{ margin: 0, marginTop: 90 }}>
                <div className="boxImgFooter" style={{ marginLeft: 0 }}>
                  <img
                    className="ImgApp_store"
                    src={App_store}
                    alt="App_store"
                  />
                </div>
                <div className="boxImgFooter">
                  <img
                    className="ImgGoogle_play"
                    src={Google_play}
                    alt="Google_play"
                  />
                </div>
              </div>
            </div>

            <div style={{ float: "left", marginLeft: 10 }}>
              <Autocomplete
                id="country-select-demo"
                sx={{ width: 200, background: "#ffff" }}
                options={data}
                autoHighlight
                getOptionLabel={(option) => option.label}
                onChange={(event, value) => switchLanguage(value?.label)}
                popupIcon={
                  <MdArrowDropDown
                    style={{ color: "#034D82", width: 30, height: 33 }}
                  />
                }
                renderOption={(props, option) => (
                  <Box
                    component="li"
                    sx={{ "& > img": { mr: 2, flexShrink: 0 } }}
                    {...props}
                  >
                    {option.label}
                  </Box>
                )}
                renderInput={(params) => (
                  <TextField
                    {...params}
                    label="Choose a language"
                    inputProps={{
                      ...params.inputProps,
                      autoComplete: "new-password",
                    }}
                  />
                )}
              />
              <p className="textFooter1">{FooterEN[3].label}</p>

              <p className="textFooter1">{FooterEN[4].label}</p>

              <p className="textFooter1">{FooterEN[5].label}</p>
            </div>

            <div style={{ float: "left", marginLeft: 150 }}>
              <p className="textFooter1">{FooterEN[6].label}</p>

              <p className="textFooter2">{FooterEN[7].label}<br/>{FooterEN[8].label}<br/>09.00 - 18.00</p>

              <div style={{ marginTop: 10 }}>
                <button
                  className="boxIconsFooter"
                  style={{
                    marginLeft: 0,
                  }}
                  onClick={() => {
                    window.open(
                      "https://www.facebook.com/translation.hero.company"
                    );
                  }}
                >
                  <FaFacebookF className="IconsFooter" />
                </button>

                <button
                  className="boxIconsFooter"
                  onClick={() => {
                    window.open("https://www.instagram.com/translationhero/");
                  }}
                >
                  <BsInstagram className="IconsFooter" />
                </button>

                <button
                  className="boxIconsFooter"
                  onClick={() => {
                    window.open(
                      "https://www.linkedin.com/in/translation-hero/"
                    );
                  }}
                >
                  <FaLinkedinIn className="IconsFooter" />
                </button>

                <button
                  className="boxIconsFooter"
                  onClick={() => {
                    window.open("https://twitter.com/Translationhero");
                  }}
                >
                  <BsTwitter className="IconsFooter" />
                </button>
              </div>
            </div>
          </div>

          <div className="ContentFooter2">
            <p className="textFooter3">{FooterEN[9].label}.</p>
            <p className="textFooter4">{FooterEN[5].label}</p>
          </div>
        </>
      ) : languages === "Thai" ? (
        <>
          <div className="ContentFooter">
            <img src={logo} alt="logo" style={{ width: 160, float: "left" }} />
            <div style={{ float: "left", marginLeft: 100 }}>
              <p className="textFooter1">{Footer[0].label}</p>
              <p className="textFooter1">{Footer[1].label}</p>
              <p className="textFooter1">{Footer[2].label}</p>
              <div style={{ margin: 0, marginTop: 90 }}>
                <div className="boxImgFooter" style={{ marginLeft: 0 }}>
                  <img
                    className="ImgApp_store"
                    src={App_store}
                    alt="App_store"
                  />
                </div>
                <div className="boxImgFooter">
                  <img
                    className="ImgGoogle_play"
                    src={Google_play}
                    alt="Google_play"
                  />
                </div>
              </div>
            </div>

            <div style={{ float: "left", marginLeft: 10 }}>
              <Autocomplete
                id="country-select-demo"
                sx={{ width: 200, background: "#ffff" }}
                options={data}
                autoHighlight
                getOptionLabel={(option) => option.label}
                onChange={(event, value) => switchLanguage(value?.label)}
                popupIcon={
                  <MdArrowDropDown
                    style={{ color: "#034D82", width: 30, height: 33 }}
                  />
                }
                renderOption={(props, option) => (
                  <Box
                    component="li"
                    sx={{ "& > img": { mr: 2, flexShrink: 0 } }}
                    {...props}
                  >
                    {option.label}
                  </Box>
                )}
                renderInput={(params) => (
                  <TextField
                    {...params}
                    label="Choose a language"
                    inputProps={{
                      ...params.inputProps,
                      autoComplete: "new-password",
                    }}
                  />
                )}
              />
              <p className="textFooter1">{Footer[3].label}</p>

              <p className="textFooter1">{Footer[4].label}</p>

              <p className="textFooter1">{Footer[5].label}</p>
            </div>

            <div style={{ float: "left", marginLeft: 150 }}>
              <p className="textFooter1">{Footer[6].label}</p>

              <p className="textFooter2">{Footer[7].label}<br/>{Footer[8].label}<br/>09.00 - 18.00</p>

              <div style={{ marginTop: 10 }}>
                <button
                  className="boxIconsFooter"
                  style={{
                    marginLeft: 0,
                  }}
                  onClick={() => {
                    window.open(
                      "https://www.facebook.com/translation.hero.company"
                    );
                  }}
                >
                  <FaFacebookF className="IconsFooter" />
                </button>

                <button
                  className="boxIconsFooter"
                  onClick={() => {
                    window.open("https://www.instagram.com/translationhero/");
                  }}
                >
